@FranckShinka @lordmahammer @OldAya 1. C'est mal comprendre le succès (puis la défaite) de Trump.

Chez lui, le fond, c'est la forme. S'il a séduit, ce n'est pas par la cohérence de son programme, c'est par sa communication capable d'électriser les foules.

Il a été le porte-parole d'une rage.

@Hexxing_BIade "Ah. You're angry with me."

Was all they could muster, unable to put together a decent response. Nothing he had said was objectively wrong, but they couldn't help the feeling that they were about to be thrown away once more.

They take his rage with a silent, solemn smile. —

@shipman96 @BarackObama Maybe you shouldn't have played roid rage late night dive bar bouncer and banned me from entry in the primary.

 Now, next morning you ask me to bring my stitched up skull in to help you sweep up?

F off, you disingenuous POS!
